import React from "react";
import OneMessage from "./message/oneMessage";

class ViewOldMessages extends React.Component {




    render(){
        return(
            <> 
                {this.state.messagess.map((message, index) => {
                    return(
                            <OneMessage
                                id = {this.props.id}
                                auteur = {this.props.auteur}
                                photo = {this.props.photo}
                                message = {this.props.message}
                                createdAt = {this.props.createdAt}
                                updatedAt = {this.props.updatedAt}
                                key = {index}
                                deleteMessage = {this.HandleDeleteMessage(message.id)}
                            />
                    )
                })}

            </>
            )
    }
}
export default ViewOldMessages
